    false,nt"url": null,nt"notes": "The nearshore sensors are part of the Pacific
    Islands Ocean Observing System (PacIOOS) and are designed to measure a variety of
    ocean parameters at fixed point locations along the south shore of Oahu. NS01 is
    located at the Waikiki Yacht Club and is fixed to the bridge pier. The instrument
    is a Sea-Bird Electronics model 16+ V2 coupled with a WET Labs ECO-FLNTUS combination
    sensor. The package is fixed to a piling ~0.5m below mean sea level.",nt"license_title":
